import React,{Component} from 'react';
import{Link} from 'react-router-dom';

class Nav extends Component{

    render(){
        return(
            <div>
                <Link to="/list">마이페이지</Link>
                <Link to="/logout">로그아웃</Link>
            </div>
        )
    }
}
export default Nav;
